import React from 'react';
import Opts from './Menu-opt'
import camp12 from '../../images/camp12.png';
import camp13 from '../../images/camp13.png';
// import Header from '../Header'
import auth from '../../controller/routes/auth';

const Home = (props) => {
  const user = JSON.parse(localStorage.getItem('user'));

  return (
    <>
      <nav class="navbar navbar-light bg-light">
        <a class="navbar-brand" href="#">Navbar</a>
      </nav>

      <section id="home-menu" className="fill-available mb-4 container-fluid d-flex flex-wrap align-content-around justify-content-center">
        <Opts click={() => { return auth.login(() => { props.history.push("/orders") })}} name="CATALOGO" imgMenu={camp12} />
        <Opts click={() => { return auth.login(() => { props.history.push("/pedidos") })}} name="PEDIDOS"  />
        <Opts click={() => { return auth.login(() => { props.history.push("/admin")  })}} name="CATALOGO" imgMenu= {camp13}  />}
      </section>
    </>
  )
}

export default Home;
